      "launched_on_year": 2014,
      "launched_on_day": 3,
      "launched_on_month": 3,
      "launched_on": "2014-03-03",
      "launched_on_trust_code": 7,
      "description": "Welcome to Loci!\r\n\r\nLoci is a location based awareness game. You will be dropped at pre-determined locations in single player mode and random locations in the multiplayer modes using Google street view. From the street view you will then use the arrows to wander around observing your surroundings trying to come to the ultimate conclusion of where you are in the world. Once you believe you have a good understanding of where you have been dropped, you will tap the \u201cGuess on Map,\u201d button located at the bottom of your screen. On this screen you will tap once on your screen to drop a pin on your guess. Depending on how close your guess is to the actual location you will be awarded a number of points. The person with the most points wins the match.\r\n\r\nEnjoy playing against up to 4 of your friends at a time in one of our many formats, or take on Loci by yourself in our single player mode.\r\n\r\n",
      "created_at": 1405277629,
      "updated_at": 1405277684
